import "./Sidebar.css"
import {SidebarData} from "./SidebarData"
import {Link} from "react-scroll"
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as BsArrowBarRight from "react-icons/bs";




export default function Sidebar() {
    return (

        <div className="Sidebar">

            <BsArrowBarRight />





            <nav className={sidebar ? "sidebar-active" : "nav-menu"}>

                {SidebarData.map((val, key) => {
                return (

                       <Link className="links" 
                            activeClass="active"
                            to={val.title}
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={500}
                             >

                        <div id="icon" >
                            {val.icon}
                        </div>
                        <div id="title">
                            {val.title}
                        </div>

                        </Link>
                )

                })}


            </nav>

            </div>
    )
}













